import React, { useState } from 'react';
import MapOfParos from '../MapOfParos/MapOfParos';
import Location from '../../model/Location';
import './Home.scss';
import LocationComponent from '../Location/LocationComponent';

const Home : React.FC = props => {
    const [day, setDay] = useState(1);
    const locations = Location.getLocations();
    const locationOfTheDay = locations[day];

    return (
        <div className={`home`}>
            <header>
                <h2>welcome to</h2>
                <h1>Paros</h1>
            </header>
            <MapOfParos day={day} setDay={setDay}/>
            <LocationComponent location={locationOfTheDay} />
        </div>
    );
}

export default Home;
